def is_valid_route(p: str) -> str:
    """"""
    path = {'A': {'0': 'X', '1': 'Y'}, 'B': {'0': 'Y', '1': 'X'}, 'W': {'0': 'B', '1': 'Y'}, 'X': {'0': None, '1': 'Z'}, 'Y': {'0': 'X', '1': None}, 'Z': {'0': 'W', '1': 'B'}}
    pos = 'A'
    for ch in p:
        pos = path[pos][ch]
        if pos is None:
            return 'No'
    return 'Yes' if pos == 'B' else 'No'
